INSERT INTO `research` (`id`, `title`, `author`, `abstract`, `course`, `adviser`, `year1`, `date_added`, `file`) VALUES
(62, 'Fish Eye- A Web Application for Identifying Fishes', 'Firmalino, Dan Alvin E.  Gatos, Kyle Edward C.  Santos, Jerry Lee I.  Sapin, Dan Jeremy P.', 'Fish Eye - A web application for identifying fish allows for the upload or capture of a fish \r\nas well as a description of the fish to quickly and accurately identify the fish. It also has a \r\ntide chart to see the tides in Bataan. The researchers surveyed 101 respondents. To specify \r\nthe functionality of the system, the ISO 25010 software quality standards were utilized, \r\nconsisting of the following characteristics: Function Suitability, Performance Efficiency, \r\nCompatibility, Usability, Reliability, Security, Maintainability, and Portability. The study \r\nrevealed that among the 101 respondents, including 9 I.T experts, most of the respondents \r\nrated the functionality of the overall system as satisfactory in all the criteria included in \r\nISO 25010, with a general weighted mean of 3.90 The system evaluation based on \r\nFunctional Suitability got an average mean of 4.06, which was determined to be \r\nsatisfactory.', 'Information Technology', 'Percian Joseph C. Borja, MIT', '2023', '2024', '1713504879.fisheye_NoCopy (1).pdf'),
(63, 'We Organize: An Online Event Organizer and Supplier Listing', 'Bongar, John Lester D.  Morales, Romar A.  Sanchez, Joshua A. ', 'A', 'Information Technology', 'Mr. Percian Joseph Borja, MIT', '2024', '2024', '1712933183.event_organizer_NoCopy (2).pdf'),
(64, 'We Ultimate Guru: An Online Platform for Tutorial and Course  Specific Training Services', 'Enriquez, Arjay V.  Dela Rea, Zheenalyn L. Apolinario, Kervin Kiel C.  Dawana, Christian Jude C.', 'A', 'Information Technology', 'Mr. Percian Joseph C. Borja, MIT', '2022', '2024', '1712933321.Guru_NoCopy.pdf'),
(65, 'Web-Based Rental Clothing Reservation System', 'Arcenas, Jhona T.  Garcia, John Lloyd M.  Irenia, Rogelyn P.  Waje III, Alejandro D.', 'A', 'Information Technology', 'Mr. Percian Joseph C. Borja, MIT', '2023', '2024', '1712933471.Web-Based Rental Clothing Reservation System_NoCopy.pdf'),
(66, 'HOPE: Balanga Youth Development and Information Management System', 'Buenafe, Sean Chris T. Dacaya, Mark Genesis S. San Pedro, Steve Andrew T.', 'A', 'Information Technology', 'Mr. Percian Joseph C. Borja, MIT', '2023', '2024', '1712933601.Hopefinal_NoCopy.pdf'),
(67, 'Exousianavi: Empowering Navigation and Resource Discovery for Students and Teachers at Eastwoods', 'Quintana John Paul Y. Godmalin Sheena G. Malasan Jesse B.', 'EXOUSIANAVI: Empowering Navigation and Resource Discovery for Students \r\nand Teachers at EASTWOODS is a proposed initiative aimed at enhancing the campus \r\nexperience for students and teachers at Eastwoods Professional College of Science and \r\nTechnology (EPCST). The initiative leverages advanced navigation technologies, \r\nspecifically Artificial Intelligence (AI), to streamline the location of classrooms and \r\nvarious facilities on campus. Recognizing the challenges students face in navigating a large \r\nnumber of rooms, especially newcomers, ExousiaNavi aims to provide a user-friendly and \r\nefficient AI-powered environment. The technology promises real-time guidance, \r\neliminating the need for manual assistance and reducing the time and effort spent on \r\nseeking directions or deciphering unclear signage. Overall, ExousiaNavi seeks to empower \r\nstudents by offering a more intuitive and convenient way to navigate the campus', 'Information Technology', 'Mr. Percian Joseph C. Borja, MIT', '2023', '2024', '1712934232.COMPLETE-DOCS-EXOUSIA-edited-latest_NoCopy.pdf'),
(68, 'EPCST Integrated Library System', 'Gannaban, Jalwin A. Medel, Jhoana Christine G. Apostol, Erron John', 'A', 'Information Technology', 'Mr. Eric C. Almoguerra', '2024', '2024', '1712934569.DOCU EPCST ILIB _NoCopy.pdf'),
(69, 'Exploring The Potential of Virtual Reality for Araling Panlipunan Subject to The Grade 3 â€“ Galileo Students of Tenejero Integrated School, Balanga City, Bataan', 'Suarez, Corine F. Duliente, Shaine Ann C.  Gallardo, Marc Christian V.', 'A', 'Information Technology', 'Mr. Aries John G. Cayabyab', '2024', '2024', '1712934703.docu for print_NoCopy.pdf'),
(70, 'Document Tracking System In Municipality Of Orani', 'Balbuena, Ian F. Javier, Fatima C. Malibiran, Edward Melwin T. Sevilla, Crizza Mariette G', 'NO ABSTRACT', 'Information Technology', 'N/A', '2023', '2024', '1712934822.DOCUMENT TRACKING SYSTEM IN MUNICIPALITY OF ORANI_NoCopy.pdf'),
(71, 'Madtrack: Online Application Monitoring for Madmaxx With AI Assistance', 'Pangilinan, Allen Dale Q. Dominguez, Mark Louie Q. Fermin, Monica P.', 'A', 'Information Technology', 'Mr. Percian Joseph Percian Borja', '2024', '2024', '1712935137.MADTRACK_NoCopy.pdf'),
(72, 'Interactive Puzzle Game for Learning Alibata', 'Morales, Rainer S. Reclosado, Sean Lewis J. Marcha, Vannesa Joy A. Magsino, Arian Chester F.', 'The studyâ€™s findings show that 49 respondents of the Interactive Puzzle Games for Learning Alibata. gave positive feedback (satisfactory) and understood the system development. The plan was evaluated using ISO 25010 software quality standard, and the functionality was described using the characteristic. Following the completion of the system development and testing. Maâ€™am Yvonne Carandang, the adviser of 6-Carandang mentioned that the web-based application helps the students to interact and participate in the activity when theyâ€™re using the web-based application. Maâ€™am Carandang added that it helps the student to familiarize the Alibata script. The system provided them a more convinient way of teaching Alibata based on their evaluation and feedback. This means that teaching Alibata will still be possible in every generation with the help of modern technologies.', 'Information Technology', 'Mr. Nomer D. Aleviado', '2024', '2024', '1712935447.INTERACTIVE PUZZLE GAME FOR LEARNING ALIBATA_NoCopy.pdf'),
(73, 'Hoppers Bistro', 'Tabije, Adrian A. Welgas, Lord Kevin M. Aguelo, Edlyn R. Malinao, Jodale S. Abarro, Loi Carriel S.', 'No Abstract ', 'Hotel Restaurant and Services', 'Mrs. Jessalyn S. Tancio', '2023', '2024', '1712935679.HOPPERS BISTRO_NoCopy.pdf'),
