(82, 'Automatic Physical Distancing Barrier', 'Double R & S Gregorio, Robe Mari N. Madrid, Romsky M. Mangayao, Saira Marie S. Saddi, Edmon S', 'NO ABSTRACT', 'Computer Engineering', 'NO ADVISER ', '2022', '2024', '1712939109.Group-4-Automatic-Physical-Distancing-Barrier-Docu (2)_NoCopy (1).pdf'),
(84, 'Web-based Financial Aid System for Municipal Social Welfare and Development Office of Pilar, Bataan ', 'Nava, Marlou P.| Salas, Jonalyn E.| Pizarro, Jemmel V.| Pepito, Danica C.', 'Financial assistance programs offer families and individuals cash support to helpthem satisfy their basic requirements while promoting as much independence as possible.It is one of the programs or services offered by the Municipal Social Welfare andDevelopment Office of Pilar, Bataan which is obliged to offer fundamental social welfareprograms and services to its underprivileged population.These people should be provided with an efficient way to apply for financialassistance programs. As some MSWD offices still use the traditional way, people may havedifficulties in applying for financial assistance particularly the cost of travel when thesepeople will come from distant places. MSWD offices should also be provided with a betterway of gathering information and storing data.Therefore, the researchers concluded that a web-based financial aid system will behelpful for these people. They can request financial assistance with the use of devices likesmartphones or computers as long as they have the internet at home. MSWD offices willalso benefit as the process of gathering information and storing data will be automated. Anadditional feature like generating statistical reports to determine the number of people whoapplied and if they are eligible.', 'INFORMATION TECHNOLOGY', 'Percian Joseph C. Borja, MIT', '2022–2023', '2024-04-23', '1712114405.Financial-Aid-System-for-printing.pdf');
